import React from "react";

ContactPage;

const ContactPage = () => (
  <ContactPageContainer>
    <ContactTitle>Welcome to our virtual E-Commerce page.</ContactTitle>
    <ContactText>
      Please note that this is a virtual E-Commerce page, based on a Tutorial.
      All products are note real and payments are not really proccesed. Users
      are stored on a Firebase Database and are not further used or
      commerciliazed.
    </ContactText>
  </ContactPageContainer>
);

export default ContactPage;
